		function keypress(event) {
			for (var v = 10; v < row; v++) { //all tree look is basic//
				for (var i = 0; i < 4; i++) {
					cont.getChildByName(v + "tree" + i).gotoAndStop(0);
				}
			}
			if (event.keyCode == 38 || event.keyCode == 40 || event.keyCode == 33 || event.keyCode == 34 || event.keyCode == 16 || event.keyCode == 191) {
				cont.getChildByName(jump + "tree" + where).gotoAndStop(1); //if player accedintly press some key around the "key zone" so the indication stay//
			}
			if (event.keyCode == 39) { //move right
				if (where < 3) { //the border of right select - until 3 and no more//
					where++;
				}
				cont.getChildByName(jump + "tree" + where).gotoAndStop(1); //tree with glow to show selected//
			}
			if (event.keyCode == 37) { //move left
				if (where > 0) { //the border of right select - until 0 and no less//
					where--;
				}
				cont.getChildByName(jump + "tree" + where).gotoAndStop(1); //tree with glow to show selected//
			}
			if (event.keyCode == 32) { //click on space//
				if (jump != row) { //the game is still on -didn't finished//
					var tree = cont.getChildByName(jump + "tree" + where);
					tree.gotoAndStop(1);
					if (firstJump == false) { //first jump is diffrent//
						frog.x = 253 + (where * 230);;
						frog.y = frog.y - 350;
					} else { // else- jump by formula//
						if (jump % 2 == 0) {
							frog.x = 250 + (where * 230);
							frog.y -= 250;
						} else {
							frog.x = 200 + (where * 230);
							frog.y -= 250;
						}
					}
					firstJump = true;
					for (var z = 0; z < myGame.length; z++) { //check if player choose the right answer//
						if (myGame[z][1][3].substring(0, 2) == jump) { //resoult: row=jump//
							for (i = 0; i < 3; i++) { //run on 3 options in every row from array myGame//
								if (tree.name == myGame[z][i][3]) {
									if (myGame[z][i][2] == true) {
										playMusic = createjs.Sound.play("correct");
										var Vcurrect = new lib.currectV(); //creat V near tree//
										cont.addChild(Vcurrect);
										frog.gotoAndPlay(2);
										Vcurrect.name = "Vcurrect" + countV;
										Vcurrect.x = tree.x + 185;
										Vcurrect.y = tree.y + 15;
										feedback(1); //call for feedback func to bring the frog with sign- 1=great//
										myGame[z][3] = true; //make sure answer don't repeat//
										console.log("charAt" + myGame[z][i][3].charAt(6));
										countV++;
										countFind = 0;
										i = 3; // to exit the loop, no need to keep with it//
										tree.gotoAndStop(0);
										stage.getChildByName("topBar").manyLeft.text = countV + "/" + moneCurrect;
										setTimeout(function () { //timer for the lenght of feedback//
											frog.gotoAndPlay(0);
										}, 1500);
									} else {
										console.log("incurrect");
										playMusic = createjs.Sound.play("incorrect");
										if (myGame[z][i][4] == false) { //mark this item as not find in 1st time//
											myGame[z][i][4] = true;
											for (var j = 0; j < 4; j++) {
												if (myGame[z][j][2] == true) { //chang the right answer also- didn't find in1st time//
													myGame[z][j][4] = true;
												}
											}
										}
										var Xincurrect = new lib.incurrectX(); //creat X need tree//
										cont.addChild(Xincurrect);
										Xincurrect.name = "Xincurrect" + countX;
										Xincurrect.x = tree.x + 180;
										Xincurrect.y = tree.y + 20;
										feedback(2); //call for feedback func to bring the frog with sign 2=wrong//
										tree.removeChild("title"); //remove the content (only text) befor animation//
										tree.gotoAndPlay(2);
										frog.gotoAndPlay(1);
										setTimeout(function () { //timer for the lenght of feedback//
											tree.gotoAndStop(0);
											frog.gotoAndStop(0);
										}, 1500);
										countX++;
										myGame[z][3] = false; //to make answer repeat//
										countErrors++;
										countFind = 0;
										i = 3; // to exit the loop, no need to keep with it//
										creatRowError = true; //true- there is a row that need to re-creat//
									} //close else//
								} else { //close 'if' that run on 'for' loop to find the tree details//
									countFind++;
								}
							} //close 'for' loop//
							if (countFind == 3) { //means player choose the blank tree- the row need to re-creat//
								tree.gotoAndStop(0);
								myGame[z][3] = false;
								creatRowError = true;
								countFind = 0;
							}
							if (creatRowError == true) { //means- need to re-creat some row//
								creation();
								creatRowError = false; //false- no row that need to re-creat//
							}
						} //close if that find which "block" we are on(which 3 ans row)//
					} //end of for//
				}
				if ((row - jump) > 1) { //as long as the game didn't end//
					jump++;
					cont.getChildByName(jump + "tree" + where).gotoAndStop(1); //tree with glow to show selected//
					console.log("countErrors " + countErrors);
				} else if ((row - jump) == 1) {
					stage.removeChild(topInstructions);
					playMusic = createjs.Sound.stop("gameM");
					playMusic = createjs.Sound.play("party");
					jump++;
					setTimeout(function () {
						frog.x = 620;
						frog.y = 120;
						titleCount.visible = true;
						titleCount.font = "100px Arial";
						titleCount.text = "פנו מקום - יש לי מוב חזק!";
					}, 2000);
					setTimeout(function () {
						endOfGame();
					}, 7000);
					console.log("add bank");//bank is start move on ticker//
				}
				console.log("jump: " + jump + "row: " + (row));
			}
			if (event.keyCode == 77) { // m = mute sound//
				stopMusic();
				cont.getChildByName(jump + "tree" + where).gotoAndStop(1); //to keep the tree seems selected//
			}
			if (event.keyCode == 80) { // p = pause game//
				pause();
				cont.getChildByName(jump + "tree" + where).gotoAndStop(1); //to keep the tree seems selected//
			}
			if (event.keyCode == 187) { //speed up//
				cont.getChildByName(jump + "tree" + where).gotoAndStop(1); //to keep the tree seems selected//			
				if (speed < 4) {
					speed = speed + 0.5;
					speedFrame++;
					stage.getChildByName("speedBar").gotoAndStop(speedFrame);
				}
			}
			if (event.keyCode == 189) { //speed down//
				cont.getChildByName(jump + "tree" + where).gotoAndStop(1); //to keep the tree seems selected//			
				if (speed > 2) {
					speed = speed - 0.5;
					speedFrame--;
					stage.getChildByName("speedBar").gotoAndStop(speedFrame);
				}
			}
		}
